import logo from './logo.svg';
import './App.css';

function App() {
  return (
      <div>
          <div>
            <Header />
          </div>
          <div className="App">
          <ul>
            <li>css</li>
            <li>html</li>
            <li>js</li>
            <li>react</li>
          </ul>
          </div>
      </div>
  );
}

function Header(){
  return(
      <div>
        <a>Home </a>
        <a>New feeds</a>
        <a> Messages</a>
      </div>
  );
}

export default App;
